var httpProxy = require('http-proxy');
var proxy = httpProxy.createProxyServer({
  target: 'http://localhost:8080/'
});

// Obtiene un objeto con los datos pasados por POST
var getPOSTData = function (req, res, cb) {
  if (req.method == 'POST') {
    var jsonString = '';
    req.on('data', function (data) {
       console.log(data);
      jsonString += data;
    });
    req.on('end', function () {
        console.log(jsonString);
      cb(JSON.parse(jsonString));
    });
  }
}

var getFORMData = function (req, res, cb) {
  if (req.method == 'POST') {
    var parseString = '{';
    var jsonString = '';
    req.on('data', function (data) {
        console.log(data);
        jsonString += data;
    });
    req.on('end', function () {
        var items = jsonString.split('&'); 
        for(var i=0;i<items.length;i++) {
            var item = items[i];
            var tokens = item.split('=');
            parseString += '"' + tokens[0] +'" : "' + tokens[1] + '"';
            if(i!=items.length-1) {
                parseString += ', ';
            }
        }
        parseString += '}';
        console.log(parseString);
        cb(JSON.parse(parseString));
    });
  }
}


